{"type":"text","text":"{
  "name": "Natural History Museum of Los Angeles County",
  "formatted_address": "900 Exposition Blvd, Los Angeles, CA 90007, USA",
  "location": {
    "lat": 34.0171448,
    "lng": -118.2886635
  },
  "formatted_phone_number": "(213) 763-3466",
  "website": "https://nhm.org/",
  "rating": 4.8,
  "reviews": [
    {
      "author_name": "Chris Westwood",
      "author_url": "https://www.google.com/maps/contrib/106483458939797362449/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjXHw5LToNie9kq7NNblGZNRm8648TmWS9yFtL3iT8z9LXqHJG-eBw=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "3 weeks ago",
      "text": "It's been such a long time since I had last visited the museum (probably close to 15 years ago) and I forgot how cool it actually is inside. First, the dinosaur exhibit is just incredible! Even if you're not a dinosaur nerd, it’s impossible not to be impressed. The gen stone and mineral hall was also really cool to see. There were so many pieces on display and it's just impressive how all of these were naturally created. The other stand out was the Wolves photography exhibit by Ronan Donovan. There were some spectacular images and you can't help but imagine how he got some of these shots and want to experience the rush and awe of the surroundings captured in his images. The other highlight was the Butterfly Pavilion (extra cost to the general admission). It's not often you get to walk through and see so many different types of butterflies firsthand. It can get a little busy inside so just move around slowly and take it all in. Finally, the \"Becoming Los Angeles\" exhibit I also found to be really cool! Learning a little more about the city, some of it's history, and diversity which shapes it's existence today. The building itself also has an historic charm and there are so many other exhibits to discover as you walk through. It's actually surprising how much time it takes to really take everything in so definitely set some time aside (at least 4 hours).",
      "time": 1750149027,
      "translated": false
    },
    {
      "author_name": "mackfrack",
      "author_url": "https://www.google.com/maps/contrib/107715168118800044012/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjW9-l41q3ri_S6xZUS_wpdJ5YFwS4XwRnnV9epoIYeN8t5RJ_Rk3A=s128-c0x00000000-cc-rp-mo-ba4",
      "rating": 5,
      "relative_time_description": "2 weeks ago",
      "text": "Beautiful museum with a wonderful selection of fossils, taxidermy, and other exhibits. We stayed for somewhere between 2 and 3 hours, and had an amazing time. There are several different gift shops located throughout the museum, and a cafe at the front. It wasn’t crowded when we went, and we were able to see all the exhibits nicely. California educators get free admission and 20% off purchases.",
      "time": 1751072724,
      "translated": false
    },
    {
      "author_name": "Alice Nakinobe",
      "author_url": "https://www.google.com/maps/contrib/117655869816050720830/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjXiRLpFVyEShrdZnJjxFhZ2m-g4FVOZk3JGBg74IhOiMuhqMXaI=s128-c0x00000000-cc-rp-mo-ba4",
      "rating": 5,
      "relative_time_description": "3 months ago",
      "text": "Visiting the Natural History Museum was an unforgettable experience! From the outside, you’d never guess the breathtaking wildlife exhibits waiting inside—so lifelike, they almost seem real. Coming from a tropical country, I was filled with joy as the displays reminded me so much of home.\nThe entrance fee is quite affordable, and you have the option to book online or purchase a ticket on-site. Students get a discount, so I’d actually recommend buying your ticket in person to take advantage of the savings.\nInside, you'll find an incredible variety of wildlife exhibits, particularly from tropical regions, along with marine life displays, stunning gemstones, and awe-inspiring dinosaur fossils. Every corner of the museum holds something fascinating to explore.\nTo complete the experience, don’t forget to stop by the souvenir shop for a keepsake and take a stroll through the museum’s beautiful gardens. My visit was truly unforgettable, and I highly recommend it to anyone looking for a mix of education, nostalgia, and adventure!",
      "time": 1742315701,
      "translated": false
    },
    {
      "author_name": "Curtis Lannom",
      "author_url": "https://www.google.com/maps/contrib/114300880383616626361/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUcxvBR3Uvi0qxhKc97lCgl0Z91SLxnqONVWxAhVO4sohEvIMQQ5w=s128-c0x00000000-cc-rp-mo-ba6",
      "rating": 5,
      "relative_time_description": "a month ago",
      "text": "A blast from the past! Wish we had more time to visit but what we did see was great. Parking was over by the Science Center, I would recommend paying when you arrive so you don't have to worry about it on the way out. Not a huge museum so you can see everything if you have enough time.",
      "time": 1748307360,
      "translated": false
    },
    {
      "author_name": "Cigal Shaham",
      "author_url": "https://www.google.com/maps/contrib/110571857230391895596/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVbDVn-9lHZuNbdSAYhOUWbE10W-L8bGHzM013Cc-lKWEFQgAr3yA=s128-c0x00000000-cc-rp-mo-ba6",
      "rating": 5,
      "relative_time_description": "2 months ago",
      "text": "A wonderful natural history museum. Has permanent exhibits on dinosaurs, Los Angeles history, gems, and animals of the area  even the old dioramas of animals, that haven't changed since the 1980s, are fun.  The rest of the exhibits are modern. They have a wonderful butterfly pavilion outside in the Spring and Summer, and it becomes a Spider house in the Fall and Winter. They have 3D movies. A great place for a family trip for all ages, surrounded by parks for picnics.",
      "time": 1747003810,
      "translated": false
    }
  ],
